import React, { useState, useEffect } from 'react';
import { Switch, Route, useHistory } from "react-router-dom"
import axios from "axios";

import { LandingPage } from "./Containers/LandingPage"
import { SearchingPage } from "./Containers/SearchingPage"

export const App = () => {
  const [results, setResults] = useState([]);
  const [start, setStart] = useState(0);
  const [searchText, setSearchText] = useState("");

  const history = useHistory();

  const getData = async () => {
    console.log({ start })
    const reply = await axios({
      method: 'get',
      url: 'http://127.0.0.1:5000/api',
      params: {
        query: 'binary search trees',
        start: start
      }
    });
    console.log(reply)
    setResults(reply.data.results)
    setStart(start + 20);
  }
  useEffect(() => {
    getData();
    // eslint-disable-next-line
  }, [])


  return (
    <div>
      <Switch>
        <Route exact path="/" render={(props) => <LandingPage searchText={searchText} setSearchText={setSearchText} {...props} />} />
        <Route path="/search" render={(props) => <SearchingPage results={history, results} {...props} />} />
      </Switch>
    </div>
  );
}
